import logo from "./logo.svg";
import "./App.css";
import { SimulationParamContainer } from "./SimulationParamContainer";
import { CreateSimulationButton } from "./createSimulationButton";
import { Title } from "./title";
import styled from "styled-components";
import { CreateSimulationModal } from "./createSimulationModal";

function App() {
  return (
    <div className="App">
      <link rel="stylesheet" href="https://use.typekit.net/vut8tpq.css" />
      <Title>
        Tissue Designer
      </Title>
      <SimulationColumn>
        <Title>Simulations</Title>
        <SimulationParamContainer simulationTitle="Sim One" simType="A" numCells="5" desc="this is my desc!"></SimulationParamContainer>
        <SimulationParamContainer simulationTitle="Sim Two"></SimulationParamContainer>
        <SimulationParamContainer simulationTitle="Sim Three"></SimulationParamContainer>
        <SimulationParamContainer simulationTitle="Sim Four"></SimulationParamContainer>
        <CreateSimulationModal />
      </SimulationColumn>
    </div>
  );

}

function SimulationColumn(props) {
  return (
    <div className="w-3/5 px-2 py-8 flex flex-col items-center justify-center">
      {props.children}
    </div>
  )
}

export default App;
